import React from "react";
import ReactDOM from "react-dom";
import {Link} from "react-router-dom";

function NavBar() {
    return (
    <div>
        <nav className="navbar navbar-dark bg-primary py-3">
            <span className="navbar-text"><Link to="HomePage"><h3 className="navbar-text-color">Home</h3></Link></span>
            <span className="navbar-text"><h3 className="navbar-text-color">Add/Edit</h3></span>
            <span className="navbar-text"><h3 className="navbar-text-color">Log Out</h3></span>
        </nav>
    </div>);
}

export default NavBar;
